import React, { useState } from 'react';

const CashDropValidation = () => {
  // --- State ---
  // dateRange: Stores the user-selected filter dates
  const [dateRange, setDateRange] = useState({ start: '', end: '' });

  // drops: This should be populated by your API fetch result
  const [drops, setDrops] = useState([]);

  // --- Handlers ---

  // Updates the workstation amount for a specific row in the state
  const handleInputChange = (id, value) => {
    setDrops(prevDrops =>
      prevDrops.map(drop =>
        drop.id === id ? { ...drop, workstationAmount: value } : drop
      )
    );
  };

  // Logic for a single row reconciliation
  const reconcileSingle = (id) => {
    setDrops(prevDrops => prevDrops.map(drop => {
      if (drop.id === id) {
        const isMatch = parseFloat(drop.systemAmount) === parseFloat(drop.workstationAmount);
        if (isMatch) return { ...drop, reconciled: true };
        else alert(`Mismatch detected for Drop ${id}. Please check the amounts.`);
      }
      return drop;
    }));
  };

  // Logic for the 'Reconcile All' button at the top
  const reconcileAll = () => {
    setDrops(prevDrops => prevDrops.map(drop => {
      // Only attempt to reconcile if not already true and an input exists
      if (!drop.reconciled && drop.workstationAmount) {
        if (parseFloat(drop.systemAmount) === parseFloat(drop.workstationAmount)) {
          return { ...drop, reconciled: true };
        }
      }
      return drop;
    }));
  };

  return (
    <div className="min-h-screen bg-gray-50 p-6 text-gray-900 font-sans">
      <div className="max-w-7xl mx-auto bg-white shadow-sm rounded-xl overflow-hidden border border-gray-200">

        {/* TOP BAR: Filters & Global Actions */}
        <div className="p-6 border-b border-gray-100 flex flex-col md:flex-row justify-between items-end gap-4">
          <div className="flex gap-4">
            <div className="flex flex-col">
              <label className="text-xs font-bold text-gray-400 uppercase mb-1">Start Date</label>
              <input 
                type="date" 
                className="border border-gray-300 rounded-md p-2 focus:ring-2 focus:ring-blue-500 outline-none"
                onChange={(e) => setDateRange({ ...dateRange, start: e.target.value })}
              />
            </div>
            <div className="flex flex-col">
              <label className="text-xs font-bold text-gray-400 uppercase mb-1">End Date</label>
              <input 
                type="date" 
                className="border border-gray-300 rounded-md p-2 focus:ring-2 focus:ring-blue-500 outline-none"
                onChange={(e) => setDateRange({ ...dateRange, end: e.target.value })}
              />
            </div>
          </div>

          <button 
            onClick={reconcileAll}
            className="bg-emerald-600 hover:bg-emerald-700 text-white font-bold py-2.5 px-6 rounded-lg transition-colors shadow-sm"
          >
            Reconcile All
          </button>
        </div>

        {/* TABLE SECTION */}
        <div className="overflow-x-auto">
          <table className="w-full text-left">
            <thead>
              <tr className="bg-gray-50 text-gray-500 text-xs uppercase tracking-wider">
                <th className="px-6 py-4 font-semibold">Drop Details</th>
                <th className="px-6 py-4 font-semibold">System Amount</th>
                <th className="px-6 py-4 font-semibold">Workstation Amount</th>
                <th className="px-6 py-4 font-semibold">Status</th>
                <th className="px-6 py-4 font-semibold text-center">Action</th>
              </tr>
            </thead>
            <tbody className="divide-y divide-gray-100">
              {drops.length > 0 ? (
                drops.map((drop) => (
                  <tr key={drop.id} className="hover:bg-gray-50/50 transition-colors">
                    <td className="px-6 py-4">
                      <div className="font-medium text-gray-900">{drop.id}</div>
                      <div className="text-xs text-gray-400">{drop.timestamp || 'N/A'}</div>
                    </td>
                    <td className="px-6 py-4 font-mono font-semibold text-blue-600">
                      ${drop.systemAmount}
                    </td>
                    <td className="px-6 py-4">
                      <input 
                        type="number" 
                        step="0.01"
                        placeholder="Enter amount"
                        disabled={drop.reconciled}
                        value={drop.workstationAmount}
                        onChange={(e) => handleInputChange(drop.id, e.target.value)}
                        className={`w-32 border rounded-md p-2 text-sm outline-none focus:ring-2 focus:ring-blue-400 ${
                          drop.reconciled ? 'bg-gray-100 text-gray-500 cursor-not-allowed' : 'bg-white'
                        }`}
                      />
                    </td>
                    <td className="px-6 py-4">
                      <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-bold ${
                        drop.reconciled ? 'bg-green-100 text-green-700' : 'bg-red-100 text-red-600'
                      }`}>
                        {drop.reconciled ? 'True' : 'False'}
                      </span>
                    </td>
                    <td className="px-6 py-4 text-center">
                      <button 
                        onClick={() => reconcileSingle(drop.id)}
                        disabled={drop.reconciled || !drop.workstationAmount}
                        className={`px-4 py-1.5 rounded-md text-xs font-bold transition ${
                          drop.reconciled 
                          ? 'bg-gray-100 text-gray-400 cursor-not-allowed' 
                          : 'bg-blue-50 text-blue-600 hover:bg-blue-600 hover:text-white border border-blue-200'
                        }`}
                      >
                        Reconcile
                      </button>
                    </td>
                  </tr>
                ))
              ) : (
                <tr>
                  <td colSpan="5" className="px-6 py-12 text-center text-gray-400 italic">
                    No cash drops found for the selected date range.
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default CashDropValidation;
